<pre><code>Offer {
id,
name
}

OfferCategory {
 offerId,
 categoryId
}

Category {
id,
name
}
</code></pre>

<p>I want to retrieve al Offers with their Categories including the name in the same query (before that, I filter using a geoNear step). I have this but its bringing an empty <code>categoriesObj</code> array. I think that the <code>localField</code> of the last <code>$lookup</code> operation is not correct:</p>

<pre><code>db.Offer.aggregate([
{
    $geoNear: {
        near: { type: "Point", coordinates: [ -58, -34 ] },
        distanceField: "dist.calculated",
        maxDistance: 200,
        spherical: true
    }
},
{
    $lookup: {
                from: "OfferCategory",
                localField: "_id",
                foreignField: "offerId",
                as: "categories"
    }
},
{
    $lookup: {
                from: "Category",
                localField: "categories._id",
                foreignField: "_id",
                as: "categoriesObjs"
    }
},
]);
</code></pre>

