Dynamic Match Variable Mongodb<p>I want to be able to pass a dynamic BSON variable to match for mongodb.</p>

<p>Here is what I have tried:</p>

<pre><code>var query = "\"info.name\": \"ABC\"";
</code></pre>

<p>and</p>

<pre><code>var query = {
    info: {
        name: "ABC"
    }
}
</code></pre>

<p>Neither of these work when passing variable 'query' to match (like below):</p>

<pre><code>$match: {
   query
}
</code></pre>

<p>but explicitly passing like below does work:</p>

<pre><code>$match: {
   "info.name": "ABC"
}
</code></pre>

