Aggregate statistics per-day even if missing records<p>Trying to get statistics from the past x days.
This works except for the days where I don't have data for.
Now I could work around this with a PHP script, but i'd rather have it say "0" at the count if there is no record on said day.</p>

<p>TLDR; i want to count back from today to 30 days ago and get the amount of records per-day even if there are no records (0).</p>

<pre><code>    /**
     * Get Multi Count
     */
    public static function getMultiCount() {

        global $mongo;

        $timestamps = [];
        for($i = 30; $i &gt;= 0; $i--) {
            $timestamps[] = date('Y-m-d', strtotime('-'.$i.' days'));
        }

        $result = [];
        foreach(array_keys(self::$config) as $collection) {
            $datecol = self::$config[$collection]['datecol'];
            $ops = [
                [
                    '$group' =&gt; [
                        "_id" =&gt; [
                            '$dateToString' =&gt; [
                                "format" =&gt; "%Y-%m-%d",
                                'date' =&gt; '$' . $datecol
                            ]
                        ],
                        "count" =&gt; [
                            '$sum' =&gt; 1
                        ],
                    ]
                ],
                [
                    '$sort' =&gt; [
                        '_id' =&gt; 1
                    ]
                ],
                [
                    '$match' =&gt; [
                        '_id' =&gt; [
                            '$in' =&gt; $timestamps
                        ]
                    ]
                ]
            ];
            $aggregation = $mongo-&gt;aggregate($collection, $ops);
            foreach($aggregation as $k =&gt; $values) {
                $result[$collection]['labels'][] = $values['_id'];
                $result[$collection]['counts'][] = $values['count'];
                $result[$collection]['background_colors'][] = "rgba(" . rand(10, 255) . "," . rand(10, 255) . "," . rand(80, 255) . ",0.4)";
            }
        }

        return $result;

    }
</code></pre>

<p>My goal is to get something like this for 30 days...</p>

<pre><code>  ["docdata_errors"]=&gt;
  array(3) {
    ["labels"]=&gt;
    array(3) {
      [0]=&gt;
      string(10) "2019-09-10"
      [1]=&gt;
      string(10) "2019-09-17"
      [2]=&gt;
      string(10) "2019-09-19"
    }
    ["counts"]=&gt;
    array(3) {
      [0]=&gt;
      int(2)
      [1]=&gt;
      int(4)
      [2]=&gt;
      int(6)
    }
    ["background_colors"]=&gt;
    array(3) {
      [0]=&gt;
      string(20) "rgba(119,93,143,0.4)"
      [1]=&gt;
      string(20) "rgba(32,150,160,0.4)"
      [2]=&gt;
      string(19) "rgba(92,87,255,0.4)"
    }
  }
</code></pre>

<p>Though since I don't have data for all of the days, it'll return 30 indexes apart from the ones that aren't recorded; the ones I don't have data for.</p>

