<p>I've tried populating the recipe model with the ingredient documents and then summing the nested calorie field, but I can't figure out how to sum the totals of the nested calorie field. I've also successfully calculated the totals and posted it to the database when creating a new ingredient using embedded url during posting, but that doesn't work because that's good only if the ingredient belongs to only one recipe. Here, I have ingredients belonging to multiple recipes.</p>

<p>Below are code snippets for how I'm currently approaching this. Recipe model has an array of ingredient Ids. The recipe controller looks at the ingredients documents for ones with the matching Id. Then, from the matching ingredients documents, the recipe controller sums the calories fields and saves it to "score". When I get all recipes in postman, the output in postman is correct. It shows the score field with the correct value. However, the mongodb database does not update the score field in the recipe document. </p>

<p>// Recipe Controller</p>

<pre><code>...

exports.getPostTotals = catchAsync(async (req, res, next) =&gt; {
const stats = await Post.aggregate([
